import logo from './logo.svg';
import './App.css';
import { loginUser } from './reducer';
import { useDispatch } from 'react-redux';
function App() {
const dispatch=useDispatch()
  return (
    <div className="App">
     <button onClick={()=>dispatch(loginUser)}>
      login
     </button>
    </div>
  );
}

export default App;
